	private static String getXmlText(String xml, String parent, String name) {
		String parentXml = getContext(xml, parent);
		return getContext(parentXml, name);
	}

	private static String getContext(String xml, String name) {
		if (StringUtil.isBlank(xml))
			return null;
		String result = null;
		String startParent = "<" + name + ">";
		String endParent = "</" + name + ">";
		int parentStartIndex = xml.indexOf(startParent) + startParent.length();
		int parentEndIndex = xml.lastIndexOf(endParent);
		if (parentStartIndex < 0 || parentEndIndex < 0
				|| parentStartIndex > parentEndIndex)
			return null;
		result = xml.substring(parentStartIndex, parentEndIndex);
		if ("".equals(result.trim()))
			return null;
		return result.trim();
	}

